import './App.css';
import Photo from './components/photo';
import BioData from './components/bioData';

function App() {
  return (
    <div className="App">
      <Photo className="photoComponent" photo="https://www.w3schools.com/howto/img_avatar.png"/>
      <BioData className="bioDataComponent" name="John Doe" age="25" email="something@gmail.com" phone="1234567890" address="1234 Main St"/>
    </div>
  );
}

export default App;
